import React, { useState } from "react";
import { BsJournalPlus } from "react-icons/bs";

const ClearAllTodos = () => {
  const word = {
    title: BsJournalPlus, 
  }

  return (
    <div className="text-white text-center text-2xl">
      <span>{word}</span> <br />
      <button onClick={inc}>START</button>
    </div>
  );
};

export default ClearAllTodos;
